import './App.css';
import Header from './Header';
import { Routes, Route } from 'react-router-dom'
import Layout from './Layout';
import Post from './Post';


function App() {
  return (
    <Routes>
      <Route index element={
        <>
          <Layout />
          <Post />
        </>
      }>
      </Route>

      <Route path={'/login'} element={
        <Layout />
      }></Route>
      <Route path={'/register'} element={
        <Layout />
      }></Route>

    </Routes>

  );
}

export default App;
